‚Äâ
@yayasmcr is a halal Asian fusion restaurant located in Cheetam Hill, Manchester. We have been wanting to try this place for a while now and had heard some mixed reviews about the place. ‚Äâ
‚Å£‚Äâ
Here we have the Yayas special fillet steak which is covered in cheese. The meat was cooked well (We ordered medium rare), and the chips were really good but the best side was the mash. This is probably the best mash we have ever had it was so creamy and nice and it was just incredible. We got the peppercorn sauce which was good but in hindsight would order the creamy peppercorn sauce. In the next picture we can see the lasagne which also was really good however the portion size wasnt the biggest. The taste was amazing however. Lastly we can see the strawberry daiquiri which was decent.‚Äâ
‚Äâ
Overall we would say the meal was really good and filling and reasonably priced. I would compare this place to MyLahores/Torros but would say it is a better version. They do a variety of food ranging from burgers to steaks to pastas.‚Äâ
‚Å£‚Äâ
The service was good and the food came quite fast. Looks like they had been through a renovation so there was still some wires hanging down from the ceiling so wasnt fully finished but the place was quite nice inside. It was busy which shows a lot. ‚Äâ
‚Å£‚Äâ
Food: 8.5/10‚Å£‚Äâ
Value for Money: 7.5/10‚Å£‚Äâ
Atmosphere: 7/10‚Å£‚Äâ
